import React from 'react'

const Result = (props) => {
    return (
        <div className='div-row'>
            <div className='div-col'>{this.props.surname}</div>
            <div className='div-col'>{this.props.surname}</div>
            <div className='div-col'>{this.props.sname}</div>
            <div className='div-col'>{this.props.bdate}</div>
            <div className='div-col'>{this.props.identif}</div>
            <div className='div-col'>{this.props.addressLast}</div>
            <div className='div-col'>{this.props.ateAddress}</div>
            <div className='div-col'>{this.props.dsdDateRec}</div>                        
        </div>
    )
}

export default Result;
